int main() {
    Solution s;
    vector<string> words = {"abc","aaaaa","bcdef"};
    string target = "aabcdabc";
    cout << s.minValidStrings(words, target) << endl;

    words = {"abababab","ab"};
    target = "ababaababa";
    cout << s.minValidStrings(words, target) << endl;

    words = {"abcdef"};
    target = "xyz";
    cout << s.minValidStrings(words, target) << endl;

    words = {"","","",""};
    target = "";
    cout << s.minValidStrings(words, target) << endl;

    return 0;
}